    /** @noinspection DataFlowIssue*/
    @Override
    public void createOrEdit(@Nullable ServerConfig config, Consumer<ServerConfig> configCallback) {
        AccountUtils.AccountSelector accountSelector = new AccountUtils.AccountSelector(lang, config);

        String displayName = ror(() -> config.get("name").getAsString(), "");
        String host = ror(() -> config.host(), "");
        String port = ror(() -> String.valueOf(config.port()), "");

        CharSequence[] protocolTexts = new CharSequence[1 + SUPPORTED_PROTOCOLS.size()];
        int currentProtocol = config == null ? 0 : config.get("protocol").getAsInt();
        protocolTexts[0] = lang.add("AUTO", "");
        for (int i = 0; i < SUPPORTED_PROTOCOLS.size(); i++) {
            Protocol protocol = SUPPORTED_PROTOCOLS.get(i);
            protocolTexts[i + 1] = protocol.min()
                    + (protocol.max() == null ? "" : "~" + protocol.max())
                    + " (" + protocol.protocol() + ")";
            if (currentProtocol == protocol.protocol())
                currentProtocol = i + 1;
        }

        new CustomFormBuilder()
                .setTitle(config == null ? lang.add("Add a server", "") : lang.add("Edit the server", ""))
                .processing(accountSelector)
                .addInput(lang.add("Display name", ""), "Minecraft Server", displayName)
                .addInput(lang.add("Host", ""), "127.0.0.1", host)
                .addInput(lang.add("Port", ""), "19132", port)
                .addDropdown(lang.add("Protocol version", ""), protocolTexts, currentProtocol)
                .setCallback(callback -> tryCatch(() -> {
                    if (callback.isCancel()) return;
                    JsonArray response = callback.responseData();

                    String mName = response.get(1).getAsString();
                    if (mName.isEmpty()) mName = "Minecraft Server";
                    String mHost = response.get(2).getAsString();
                    if (mHost.isEmpty()) mHost = "127.0.0.1";
                    String mPort = response.get(3).getAsString();
                    if (mPort.isEmpty()) mPort = "19132";

                    int protocol = response.get(4).getAsInt();
                    if (protocol == 0) protocol = -1;
                    else protocol = SUPPORTED_PROTOCOLS.get(protocol - 1).protocol();

                    ServerConfig edited = new ServerConfig(mHost, Integer.parseInt(mPort));
                    accountSelector.save(callback, edited);
                    edited.add("name", mName);
                    edited.add("protocol", protocol);
                    configCallback.accept(edited);
                }))
                .show(getActivity());
    }

    @Override
    public void motd(ServerConfig config, MotdCallback motdCallback) {
        motdCallback.title(MCFontWrapper.WRAPPER.wrap(config.get("name").getAsString()));
        String host = config.host();
        int port = config.port();

        BEMotdChecker.BEMotd motd = BEMotdChecker.get(host, port);
        if (motd == null) {
            motdCallback.summary(MCFontWrapper.WRAPPER.wrap(SS + "4Timed out"));
            return;
        }

        motdCallback.icon(ResourcesUtils.getPixelDrawable(getActivity(), R.drawable.bedrock));
        motdCallback.summary(MCFontWrapper.WRAPPER.wrap(motd.motd()+ " - " + motd.version()));
        motdCallback.topText(motd.onlinePlayer() + "/" + motd.maxPlayer());

        int delay = motd.delay();
        int topIcon;
        if (delay < 100) topIcon = R.drawable.ping_green_dark;
        else if (delay < 200) topIcon = R.drawable.ping_yellow_dark;
        else topIcon = R.drawable.ping_red_dark;
        motdCallback.topIcon(ResourcesUtils.getPixelDrawable(getActivity(), topIcon));
    }

    BedrockClientSession session;
    @Override
    public void connect(ServerConfig config, Consumer<Client<?>> clientCallback) throws Exception {
        if (true) throw new NoSuchProviderException(lang.add("Not available", "").toString());

        // options
        Account account = AccountUtils.AccountSelector.getAccount(config);

        String host = config.host();
        int port = config.port();

        SimpleClientRepeater simpleClient = new SimpleClientRepeater();
        final SimpleClientRepeaterHelper clientHelper = simpleClient.helper()
                .setOnMoreClickListener(v -> {
                })
                .setOnMessageListener(message -> {
                })
                .setOnCommandListener(command -> {
                })
                .setOnCloseListener(() -> {
//                    session.disconnect();
                })
                .setOnPacketSendListener((name, params) -> {
                })
                .setOnEventAddListener((name, callback) -> {
                });
        clientCallback.accept(simpleClient);
        clientHelper.connectingProgress("- " + lang.add("Connecting to server...", "..."));
        TitleController titleController = clientHelper.getTitleController();
        ScoreboardController scoreboardController = clientHelper.getScoreboardController();
        PlayerListController playerListController = clientHelper.getPlayerListController();

        BedrockCodec codec = Bedrock_v594.CODEC;

        BedrockPacketHandler bedrockPacketHandler = new BedrockPacketHandler() {
            @Override
            public PacketSignal handlePacket(BedrockPacket packet) {
                System.out.println(packet);
                return BedrockPacketHandler.super.handlePacket(packet);
            }

            @Override
            public void onDisconnect(String reason) {
                BedrockPacketHandler.super.onDisconnect(reason);
                clientHelper.close(reason);
            }
        };

        new Bootstrap()
                .channelFactory(RakChannelFactory.client(NioDatagramChannel.class))
                .group(new NioEventLoopGroup())
                .option(RakChannelOption.RAK_PROTOCOL_VERSION, codec.getRaknetProtocolVersion())
                .handler(new BedrockClientInitializer() {
                    @Override
                    protected void initSession(BedrockClientSession session) {
                        CloudburstMC_Protocol.this.session = session;

                        session.setCodec(codec);
                        session.setPacketHandler(bedrockPacketHandler);
                        session.sendPacket(new LoginPacket());
                    }

                    @Override
                    public void exceptionCaught(ChannelHandlerContext ctx, Throwable cause) throws Exception {
                        super.exceptionCaught(ctx, cause);
                        clientHelper.error(cause);
                    }
                })
                .connect(new InetSocketAddress(host, port))
                .syncUninterruptibly();
    }
